package patterns;

public class Program4 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println("main method started");
		for(int i=1;i<=5;i++)
		{
			for(int j=1;j>=5;j--)
			{
				System.out.println(j);
			}
			//System.out.println(" ");
			
		}
		
		System.out.println("main method ended");

	}

}
